import React from 'react'

const Buttons = (props) => {
    // console.log('button props', props)
    return(
        <div>
        <button onClick={() => {props.handleDeal()}}>Deal</button>
        <button onClick={() => {props.handleHit()}}>Hit</button>
        <button onClick={() => {props.handle()}}>Stand</button>
        </div>
    )
}

export default Buttons
